(177, 'Check In & Out 🕒', '📢 Attention Medtronix Team!\n\nTo ensure accurate tracking of your check-in and check-out times, please make sure to connect to the Medtronix Team or Medtronix Training Wi-Fi each day.\n\n🔗 How to Check In/Out:\n\n1. Connect your device to the Medtronix Team Wi-Fi.\n2. Scan the QR Code available at the office entrance.\n3. Your check-in or check-out will be recorded automatically!\n\nLet’s stay connected and keep things running smoothly. Thank you for your cooperation!', '2024-09-26', '2024-09-26 08:14:38', '2024-09-26 08:14:38', '[3,4,6,10,17,21,22,24,25,26,27,29,30,32,33,34,36,37,38,39,40,41]', 'admin', 'info'),
(178, 'Scheduled Website Maintenance Notification', '<p>Dear Team,</p><p>Please be informed that our website is currently undergoing scheduled maintenance to enhance performance and address any existing issues. During this time, access to certain features may be limited or unavailable.</p><p>If you encounter any issues with the website once maintenance is completed, please do not hesitate to report them to the HR department or reach out to our Web Team for assistance.</p><p>Thank you for your understanding and cooperation.</p>', '2024-10-29', '2024-10-29 10:59:49', '2024-10-29 10:59:49', '[3,4,6,10,17,21,22,24,25,26,27,29,32,33,34,36,37,38,39,40,41,42,43,44]', 'admin', 'info');
