INSERT INTO `projects` (`id`, `name`, `category`, `link`, `video`, `main_picture`, `description`, `created_at`, `updated_at`) VALUES
(1, 'Restaurants and Retails stores POS !', 'web', NULL, 'project_videos/be0dcce4-75f3-49eb-b784-e61ac2a127ce.mp4', 'project_pictures/4c8acfe1-1ea5-42fd-9611-27322ecbbbd5.jpg', 'Its helps to keep checkouts, invoicing , data transparency, staff management and many more.\r\n\r\nAvailable in Web and PC versions.\r\n\r\nMedtronix Systems looking for potential partners in these sector to perform trials . Financial and restaurant industry partners can DM us and have free Trials of Software system.', '2024-08-28 12:50:45', '2024-09-03 14:16:24'),
(2, 'Movement detection with AI', 'python', NULL, 'project_videos/54c645c5-b09c-4ba2-95af-3778c3a0f7a8.mp4', 'project_pictures/7fc0fe01-b1c6-495b-bd45-39be0b230b40.png', 'Precision Movement detection with AI offers cutting-edge precision movement detection powered by advanced AI algorithms. Whether it\'s for sports analysis, industrial automation, or healthcare monitoring, our technology captures and analyzes even the smallest movements with unmatched accuracy. Precision Movement detection with AI provides real-time insights, enabling smarter decision-making and enhancing performance across various applications. Experience the future of movement detection with our AI-driven solution.', '2024-08-28 15:02:35', '2024-09-03 14:37:00'),
(3, 'Whatsapp Summerizer and content manager', 'app', NULL, NULL, 'project_pictures/d8634fb4-715c-4c30-911a-3b4d1d437c89.jpg', 'BlabLab is one of Medtronix portfolio Android and IOS mobile app\r\n\r\nWhatsapp Summerizer and content manager helps individuals and organisations to manage WhatsApp with AI summarizer and manage data.\r\n\r\nSuch WhatsApp tools ease communication and save time.\r\n\r\nDeveloped in Flutter ,Python and Flask frameworks', '2024-08-28 15:16:38', '2024-08-28 15:16:38');
