INSERT INTO `requests` (`id`, `user_id`, `title`, `details`, `status`, `created_at`, `updated_at`) VALUES
(1, 13, 'half leave', '<p>urgent of brother</p>', 'approved', '2024-05-31 13:42:58', '2024-06-04 09:32:52'),
(2, 13, 'Sick Leave Request', '<p><strong>Dear HR,</strong></p>\r\n\r\n<p>I hope this message finds you well. I am writing to inform you that I am currently <strong>experiencing health issues</strong> that necessitate taking<strong> sick leave</strong> from work. My symptoms have made it difficult for me to perform my duties effectively, and I believe it is in the best interest of both my health and the company for me to take some time off to recover.</p>\r\n\r\n<p>I will be unable to work today, and I will provide regular updates on my condition as needed. I have informed my team and ensured that all my current tasks are either completed or handed over to colleagues to ensure that there is no disruption to our workflow.</p>\r\n\r\n<p>Thank you for your understanding and support during this time.</p>\r\n\r\n<p><strong>Best regards,<br />\r\nArbaz Ajaz</strong></p>', 'approved', '2024-06-03 10:35:10', '2024-06-04 09:33:21'),
(3, 10, 'Request for Leave Due to Final Year Project Viva', '<p>&nbsp;</p>\r\n\r\n<p>Dear Sir,</p>\r\n\r\n<p>I hope this message finds you well. I am writing to inform you that I was unable to attend work yesterday due to my final year project viva, which was scheduled unexpectedly. I apologize for the short notice and any inconvenience this may have caused.</p>\r\n\r\n<p>The viva, which is a crucial component of my academic requirements, was initially planned for yesterday but was rescheduled to today. As a result, I kindly request your understanding and approval for leave for today,06/13/2024.</p>\r\n\r\n<p>I assure you that I will make up for any missed work and will ensure that my responsibilities are covered during my absence. Please let me know if you need any further information or if there are specific arrangements you would like me to make.</p>\r\n\r\n<p>Thank you for your attention to this matter.</p>\r\n\r\n<p>Sincerely,</p>\r\n\r\n<p>Syed Muhammad Ahmad Shah<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>', 'approved', '2024-06-13 08:39:16', '2024-06-13 10:04:23'),
(4, 7, 'Application For Fever', '<p><strong>Dear : HR<br />\r\nSubject:</strong>&nbsp;Apllication for Fever<br />\r\n<br />\r\nI am not feeling well today and have a fever. I request a leave of absence for today.<br />\r\nThank you.<br />\r\nSincerely,</p>\r\n\r\n<p>Shahzad Ali</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', 'approved', '2024-06-13 08:51:57', '2024-06-13 10:04:37'),
(5, 4, 'Check In Request', '<p>Assalamu Alaikum. Sir on 14/06/2024 I was late about 10 minutes due to some personal issue&nbsp; so I was unable to mark my check in. Please mark my check in. Thanks.</p>', 'approved', '2024-06-15 09:32:51', '2024-06-24 09:44:55'),
(6, 10, 'Subject: Request to Mark Attendance as Present', '<p><strong>Syed Muhammad Ahmad Shah</strong><br />\r\nHouse Number 41, V Block<br />\r\nFarid Town<br />\r\nSahiwal</p>\r\n\r\n<p><strong>Date: 15 June 2024</strong></p>\r\n\r\n<p><strong>To:<br />\r\nARSLAN AHMAD</strong></p>\r\n\r\n<p><strong>CEO MEDTRONIX</strong><br />\r\n<br />\r\nShahroz Shabir<br />\r\nTeam Lead, Web Development<br />\r\nMedtronix System<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Subject: Request to Mark Attendance as Present</strong></p>\r\n\r\n<p>Dear Shahroz Shabir,</p>\r\n\r\n<p>I hope this message finds you well.</p>\r\n\r\n<p>I am writing to bring to your attention the reason for my late arrival at work on <strong>14 June 2024</strong>. I had an urgent personal matter that required my immediate attention. Specifically, I had to assist my friend&#39;s grandfather, who needed to be taken to the hospital due to a medical emergency. Given the urgency and critical nature of the situation, I had no choice but to prioritize this task.</p>\r\n\r\n<p>As a result of this unforeseen circumstance, I arrived at work later than usual. Unfortunately, due to the recently implemented validation on our attendance panel, I was unable to mark myself as present for the day.</p>\r\n\r\n<p>I kindly request that my attendance record for <strong>15 June 2024&nbsp;</strong>be adjusted to reflect my presence, as my late arrival was due to an unavoidable emergency. I assure you that this was an exceptional situation and that I remain committed to maintaining my punctuality and performance.</p>\r\n\r\n<p>Thank you for your understanding and consideration. Please let me know if you require any further information or documentation regarding the incident.</p>\r\n\r\n<p>Sincerely,</p>\r\n\r\n<p>Syed Muhammad Ahmad Shah<br />\r\n&nbsp;</p>', 'rejected', '2024-06-15 09:34:49', '2024-06-24 09:50:18'),
(7, 7, 'Half Leave', '<p>Dear HR&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p>I hope this message finds you well. Due to a large number of guests at our house for the occasion of Eid, I kindly request to give a half-day off today. I will be able to come to the office at 2 pm.</p>\r\n\r\n<p>Thank you for your understanding.</p>', 'approved', '2024-06-21 11:57:51', '2024-06-24 09:53:34'),
(8, 10, 'Request for Work from Home Due to Health Reasons', '<p>To</p>\r\n\r\n<p>Medtronix Systems<br />\r\nSahiwal, 57000</p>\r\n\r\n<p>Dear Mudasir Farooq,</p>\r\n\r\n<p>Subject: Request for Work from Home Due to Health Reasons</p>\r\n\r\n<p>I hope this message finds you well. I am writing to formally request permission to work from home due to health issues that require my immediate attention and recovery.</p>\r\n\r\n<p>Recently, I have been experiencing significant health problems which have been affecting my ability to commute and work effectively from the office. After consulting with my healthcare provider, it has been advised that I minimize physical exertion and avoid exposure to potentially stressful environments to facilitate my recovery.</p>\r\n\r\n<p>I propose to from home beginning on 24 June 2024, and I will ensure that I remain fully accessible during my regular working hours and will be available for any meetings or communications as required.</p>\r\n\r\n<p>Please let me know if you need any further documentation from my healthcare provider or if there are any specific protocols I need to follow to formalize this request.</p>\r\n\r\n<p>Thank you for considering my request. I appreciate your understanding and support during this challenging time. I am committed to ensuring that my health does not impede my contributions to the company, and I look forward to your positive response.</p>\r\n\r\n<p>Sincerely,</p>\r\n\r\n<p>Syed Muhammad Ahmad&nbsp;<br />\r\nWebsite Devolper&nbsp;<br />\r\nMedtronix Systems</p>', 'rejected', '2024-06-24 08:16:07', '2024-06-24 09:56:45'),
(9, 7, 'Attendance Correction Request for June 10, June 11, and June 14, 2024', '<p><strong>Dear HR || CEO&nbsp;Arslan Ahmad</strong><br />\r\nI hope this message finds you well.<br />\r\nI am writing to request a correction to my attendance records for June 10, June 11, and June 14, 2024. On these dates, I was present at the office and completed my daily tasks. However, there were some issues with recording my attendance correctly.</p>\r\n\r\n<ol>\r\n	<li><strong>June 10, 2024:</strong> I did not check out as my task was lengthy, and I left the office after 7 PM. I completed all my assigned work before leaving the office.</li>\r\n	<li><strong>June 11, 2024:</strong> I arrived a bit late and couldn&#39;t check in on time, but I was present and completed my daily tasks.</li>\r\n	<li><strong>June 14, 2024:</strong> I also arrived late and couldn&#39;t check in on time, but I completed all my daily tasks.</li>\r\n</ol>\r\n\r\n<p><strong>Please check the admin </strong>panel<strong>, review the attendance records and update them to reflect my presence and accurate working hours on these dates.</strong><br />\r\nThank you for your help.<br />\r\nBest regards,<br />\r\nShahzad Ali</p>', 'rejected', '2024-06-24 08:39:02', '2024-06-24 10:29:21'),
(10, 10, 'Subject: Request for Half-Day Leave on Saturday, 27 May 2024, for Islahi Safr', '<p><br />\r\nTo</p>\r\n\r\n<p>Mr. Mudassir Farooq<br />\r\nHr<br />\r\nMedtronix Systems</p>\r\n\r\n<p>Dear [Mr. Mudassir Farooq,</p>\r\n\r\n<p>I hope this message finds you well. I am writing to formally request a half-day leave on Saturday, 27 May 2024, to attend an important religious journey (Islahi Safr) to Islamabad.</p>\r\n\r\n<p>I have taken all necessary steps to ensure my absence will not disrupt our team&rsquo;s workflow. I will ensure that all pending tasks are completed before my departure and will be available by phone or email if any urgent matters arise during my absence.</p>\r\n\r\n<p>I apologize for any inconvenience this may cause and appreciate your understanding and support in granting me this leave. Please let me know if there are any specific procedures I need to follow to formalize this request.</p>\r\n\r\n<p>Thank you for your consideration.</p>\r\n\r\n<p>Sincerely,</p>\r\n\r\n<p>Syed Muhammad Ahmad Shah<br />\r\nWeb Developer</p>', 'approved', '2024-06-25 10:45:08', '2024-06-26 09:56:24'),
(11, 7, 'Application For Leave', '<p>Dear HR&nbsp;<br />\r\nI need to request a leave for today as I have to go out of the city for an urgent matter.<br />\r\nThank you,<br />\r\n&nbsp;</p>', 'approved', '2024-07-09 06:58:20', '2024-07-11 10:35:13'),
(12, 7, 'Request for Advance Payment of Rs. 5000', '<p><strong>Dear HR</strong></p>\r\n\r\n<p>I hope you are doing well.</p>\r\n\r\n<p>I am writing to request an advance payment of Rs. 5000. I need this amount for personal reasons and would greatly appreciate your assistance in processing this advance as soon as possible.</p>\r\n\r\n<p>Thank you for your understanding and support. Please let me know if you need any additional information.</p>\r\n\r\n<p>Best regards,<br />\r\nShahzad Ali</p>', 'approved', '2024-07-13 22:51:36', '2024-07-24 08:49:19'),
(13, 7, 'Quos aut eiusmod tem', '<p>hj</p>', 'rejected', '2024-08-06 17:20:39', '2024-08-10 11:37:46'),
(14, 29, 'Sick Leave Application', '<p>Dear HR Manager,</p><p>I hope this message finds you well. I am writing to inform you that I have been suffering from a fever since 06-oct-2024. Due to my condition, I am unable to attend work and would like to request sick leave for 1 day, day starting from 07-oct-2024.</p><p>Please let me know if any further information is required. I will keep you updated on my recovery.</p><p>Thank you for your understanding.</p><p>Sincerely,<br>Haseeb Ahmad<br>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 'approved', '2024-10-07 09:44:42', '2024-10-08 14:09:13'),
(15, 42, 'Request for Short Leave', '<p>I hope this message finds you well. I want to request a short leave for today as I need to attend to some personal matters at home. Thanks</p>', 'approved', '2024-12-06 15:11:19', '2024-12-06 15:38:03'),
(16, 43, 'Short Leave', '<p>I hope this email finds you well. I would like to request a short leave for today as I need to visit my home, which is quite far, and the travel will take significant time. Thanks</p>', 'approved', '2024-12-06 15:45:09', '2024-12-09 12:35:24'),
(17, 38, 'Leave Request from Friday to Wednesday', '<p>Dear HR,</p><p>I hope this message finds you well. I am writing to formally request leave from Thursday, January 9, 2025, to Wednesday, January 15, 2025, as I will be attending my cousin\'s wedding in Karachi.</p><p>I kindly request your approval for this leave. Thank you for your understanding and support.</p><p>Sincerely,<br>ZEESHAN</p>', 'approved', '2025-01-07 13:21:02', '2025-01-07 14:44:47');
