(201, 37, '2024-07-25', '<p>🚀 Successfully Deployed and Managed AWS EKS Cluster! 🚀</p>\r\n\r\n<p>I recently undertook the challenge of setting up an AWS EKS cluster and successfully navigated the entire process. Here&#39;s a brief overview of what I accomplished:</p>\r\n\r\n<p>Cluster Creation: Set up a new AWS EKS cluster and configured node groups.<br />\r\nDeployment: Applied pod and service configurations using AWS CLI.<br />\r\nIngress Configuration: Utilized an Ingress Controller to manage access to my pods.<br />\r\nApplication Load Balancer: Implemented an ALB for efficient load distribution.<br />\r\nDomain Management: Connected my Namecheap domain to AWS and set up SSL certificates for secure communication.<br />\r\nDNS Configuration: Created A records for subdomains and resolved various issues through troubleshooting.<br />\r\nThe result? A professionally managed and seamlessly running application&nbsp;on&nbsp;AWS&nbsp;EKS.&nbsp;🎉<br />\r\n&nbsp;</p>', '2024-07-25 12:16:40', '2024-07-25 12:16:40', 0, 0),
(202, 22, '2024-07-25', '<p><em><strong>1:Graphics designing last lecture on illustrator.</strong></em></p>\r\n\r\n<p><em><strong>2:Courses Post</strong></em></p>', '2024-07-25 13:17:06', '2024-07-25 13:17:06', 0, 0),
