(355, 36, '2024-08-15', '<p>Today I have learnt about the <strong>FDISK &nbsp;it</strong> is a command-line utility used for disk partitioning on Linux and Unix-like systems. It helps to create, delete, or manage partitions on a hard drive. Understanding how to use fdisk, partition cases, standards, and mounting is essential for effective disk management.&nbsp;</p><p>Moreover I have also learnt about FSCK (File System Consistency Check) it &nbsp;is a system utility used to check and repair file system inconsistencies on Unix-like operating systems, including Linux and macOS. It is often used when the system detects file system corruption or when the machine wasn’t properly shut down.</p>', '2024-08-15 15:56:27', '2024-08-15 15:56:27', 0, 0),
